Je m'appelle Nicolas, j'ai actuellement 19 ans.
Je travaille activement chez McDonald's afin de rembourser mon permis ainsi que ma voiture puis partir sur un autre travail plus fixe à l'avenir. 
J'ai fais des études en Bac pro MELEC (Métier de l'ÉLectricité et de ses Environnements Connectés.
J'aime écouter de la musique, discuter en vocal ou même par message, voir mes amis et mes proches. 
Mes passions sont : - écouter de la musique;
- Jouer aux jeux vidéos;
- être en appel avec mes amis;
- conduire (moto/voiture)
- voyager.

Je suis quelqu'un qui, avant d'avoir mon travail était très timide mais maintenant cela va mieux, je suis à l'écoute de chaque problèmes si besoin et surtout j'aime comme dis ci dessus discuter avec tout le monde.
